@import "../../../../assets/less/uikit";

.tablet-fraction {
  width: 100%;
  height: 100%;
  display: grid;
  grid-template-columns: @317px @661px;
  background-color: #0A0D12;

  * {
    box-sizing: border-box;
    padding: 0;
    margin: 0;
    user-select: none;
    line-height: 100%;
    color: #fff;
  }

  &-navigation {
    height: 100%;
    background-color: #0E1219;
    padding: @37px @50px;

    &__back {
      font-size: @18px;
      margin-bottom: @31px;
      display: flex;
      align-items: center;

      img {
        display: block !important;
        width: @24px;
        margin-right: @6px;
      }
    }

    &__title {
      font-size: @32px;
      margin-bottom: @34px;
      margin-left: @7px;
    }

    &-list {
      margin-left: @12px;

      &__active {
        opacity: 1 !important;

        &::before {
          content: '';
          background-color: #E3256B;
          position: absolute;
          left: 0;
          width: @4px;
          height: @14px;
          border-radius: @4px;
        }
      }

      div {
        box-sizing: content-box;
        padding: @10px 0 @10px @15px;
        font-size: @16px !important;
        position: relative;
        opacity: .5;
        transition: .15s;
        display: flex;
        align-items: center;
        cursor: pointer;

        &:hover {
          opacity: .75;
        }
      }
    }
  }

  &-body {
    height: 100%;
    padding: @35px @30px 0;
    position: relative;

    &__title {
      font-size: @40px;
      line-height: 90% !important;
      text-shadow: 0 @4px @24px #ffffff40;
    }

    &__members {
      position: absolute;
      opacity: 0.8;
      text-shadow: 0 @4px @24px #ffffff40;
      font-size: @40px;
      right: @30px;
      top: @35px;
      line-height: 100%;

      span {
        font-size: @14px !important;
        color: #fff !important;
      }
    }
  }

  &-userlist {
    width: @601px;
    margin-top: @26px;

    &-filter {
      width: 100%;
      height: @40px;
      display: flex;
      align-items: center;
      margin-bottom: @30px;

      &__checkbox {
        display: flex;
        align-items: center;
        font-size: @16px !important;
        color: #fff !important;
        margin-right: @23px;

        &-active {
          background-color: #EB5757 !important;

          img {
            display: block !important;
          }
        }

        div {
          width: @22px;
          height: @22px;
          display: flex;
          justify-content: center;
          align-items: center;
          background-color: #ffffff0d;
          margin-right: @8px;

          img {
            width: @16px;
            display: none;
          }
        }
      }

      &__input {
        width: @258px;
        height: @40px;
        display: flex;
        align-items: center;
        position: relative;
        margin-left: auto;

        input {
          width: 100%;
          height: 100%;
          background-color: #FFFFFF0C;
          border: @1px solid #FFFFFF4C;
          border-radius: @99px;
          padding: 0 @54px 0 @20px;
          font-size: @16px;
          line-height: 100%;
          color: #fff6;
        }

        img {
          position: absolute;
          right: @20px;
          width: @20px;
        }
      }
    }

    &__description {
      padding: 0 @13px;
      height: @40px;
      display: grid;
      align-items: center;
      grid-template-columns: @70px @183px @117px @161px;

      span {
        color: #ffffff80 !important;
        font-size: @14px;
      }
    }

    &-list {
      width: 100%;
      height: @516px;
      overflow-y: auto;

      &-block {
        width: 100%;
        height: @50px;
        padding: 0 @13px;
        grid-template-columns: @60px @173px @107px @171px @25px;
        grid-gap: @10px;
        background: #ffffff0d;
        border-radius: @4px;
        display: grid;
        align-items: center;
        margin-bottom: @4px;

        &:last-child {
          margin-bottom: @100px;
        }

        * {
          font-size: @16px;
        }

        &__id {
          opacity: 0.6;
        }

        &__name {
        }

        &__rebuke {
          display: flex;
          align-items: center;
          justify-content: space-between;
          width: 95%;

          &-minus, &-plus {
            width: @32px;
            height: @32px;
            border-radius: @99px;
            display: flex;
            justify-content: center;
            align-items: center;
            opacity: .7;
            transition: .15s;

            &:hover {
              opacity: 1;
            }
          }

          &-minus {
            background-color: #ffffff0d;
          }

          &-plus {
            background-color: #E3256B;
          }

        }

        &-text {
          width: 100%;
          height: @42px;
          display: flex;
          align-items: center;
          position: relative;
          font-size: @16px;
          justify-content: flex-end;
        }

        &-rank {
          width: 100%;
          height: @42px;
          display: flex;
          align-items: center;
          position: relative;
          border: @1px solid #fff3;
          border-radius: @4px;
          padding: 0 @14px;
          font-size: @14px;

          &__name {
            position: absolute;
            left: 0;
            top: 0;
            width: 100%;
            height: @42px;
            display: flex;
            align-items: center;
            padding: 0 @14px;
            font-size: @14px;
          }

          img {
            display: block !important;
            position: absolute;
            transform: rotate(-90deg);
            width: @14px;
            right: @10px;
          }

          &__active {
            border: @1px solid #fff;
            border-radius: @4px @4px 0 0;

            .tablet-fraction-userlist-list-block-rank-list {
              display: flex !important;
            }
          }

          &-list {
            display: none;
            z-index: 99999;
            border: @1px solid #fff;
            border-top: none !important;
            padding: @5px 0 @3px;
            border-radius: 0 0 @4px @4px;
            width: calc(100% + @2px);
            position: absolute;
            top: 101%;
            left: -@1px;
            flex-direction: column;
            align-items: center;
            max-height: @130px;
            overflow-y: auto !important;
            background-color: #16191E;

            div {
              width: 95%;
              min-height: @37px;
              margin: @2px 0;
              display: flex;
              background-color: #2D3034;
              border-radius: @4px;
              align-items: center;
              padding: 0 @8px;
              overflow: hidden;
              font-size: @14px;
              opacity: .85;

              &:hover {
                opacity: 1;
              }
            }
          }
        }

        &-more {
          display: flex;
          justify-content: center;
          position: relative;

          img {
            display: block !important;
            width: @30px;
            opacity: .5;

            &:hover {
              opacity: 1;
            }
          }

          &__list {
            position: absolute;
            background-color: #fff;
            box-sizing: content-box;
            padding: 0 @24px;
            z-index: 99999;
            border-radius: @4px;
            top: 100%;
            right: 50%;

            div {
              color: #000 !important;
              opacity: .75;
              white-space: nowrap;
              display: flex;
              align-items: center;
              justify-content: flex-end;
              height: @30px;
              margin: @10px 0;

              &:hover {
                opacity: 1;
              }
            }
          }
        }
      }
    }
  }

  &-cars {
    display: flex;
    flex-wrap: wrap;
    max-height: @700px;
    overflow-y: auto;
    margin-top: @30px;
    height: @626px;
    justify-content: space-between;

    &-block {
      width: @281px;
      height: @306px;
      position: relative;

      &__img {
        display: block !important;
        width: 100%;
        height: @138px;
        object-fit: cover;
      }

      &__title {
        font-size: @24px;
        margin: @14px 0;
      }

      &__description {
        opacity: .4;
        margin-bottom: @4px;
        font-size: @14px;
      }

      &-flex {
        width: 100%;
        display: flex;

        &__button {
          display: flex;
          justify-content: center;
          align-items: center;
          margin-left: auto;
          width: @112px;
          height: @39px;
          font-size: @16px;
          color: #141B1F;
          background: #FFFFFF;
          border-radius: @4px;
          opacity: .75;

          &:hover {
            opacity: 1;
          }
        }

        &-rank {
          width: @156px;
          height: @42px;
          display: flex;
          align-items: center;
          border: @1px solid #fff3;
          border-radius: @4px;
          padding: 0 @14px;
          font-size: @14px;
          position: absolute;

          &__name {
            width: @156px;
            height: @42px;
            position: absolute;
            top: 0;
            left: 0;
            display: flex;
            align-items: center;
            font-size: @14px;
            padding: 0 @14px;
          }

          img {
            display: block !important;
            position: absolute;
            transform: rotate(-90deg);
            width: @14px;
            right: @10px;
          }

          &__active {
            border: @1px solid #fff;
            border-radius: @4px @4px 0 0;

            .tablet-fraction-cars-block-flex-rank-list {
              display: flex !important;
            }
          }

          &-list {
            display: none;
            z-index: 99999;
            border: @1px solid #fff;
            border-top: none !important;
            padding: @5px 0 @3px;
            border-radius: 0 0 @4px @4px;
            width: calc(100% + @2px);
            position: absolute;
            top: calc(100% + @1px);
            left: -@1px;
            flex-direction: column;
            max-height: @150px;
            overflow-y: auto !important;
            background-color: #16191E;

            div {
              width: 95%;
